package Inheritance;

public class A_Myclass {
	
	public static String myName = "Priya";
	public String myFriend = "Sri";
	public String mySister = "Sathya";

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		A_Myclass abc = new A_Myclass();
		
		System.out.println("myName");
		System.out.println("myFriend");
		System.out.println("mySister");
	}

}
